	document.getElementById("myVideo").load();

}

function myFunction() {
  document.getElementById("myVideo").load();
}


export default () => (
	<div className='landing'>
		<div className='info'>

<video  >
		<iframe width="1000rem" height="1000rem" src="https://www.learningcontainer.com/bfd_download/sample-mp4-file/" onloadedmetadata="this.autoplay = true" allow="autoplay" id="audio">	</iframe>
		<source width="100rem" height="100%"  src="https://www.learningcontainer.com/bfd_download/sample-mp4-file/" allow="autoplay" id="audio" type="video/mp4">
						</source>
</video>


		<h2>
		New Wave
		</h2>
		<h3>Property Group</h3>
			<p class="animated fadeInUp">We take your dream home and make it real.</p>
			<Link to='/contactpage'>
			<button className="button1">BOOK YOUR CONSULTATION</button>
			</Link>

		</div>
	</div>
);
